import React from 'react'
import {HomeContainer, HomeBackground} from './HomeBlockElements'

const HomeBlock = () => {
    return (
        <HomeContainer>
            <HomeBackground>
                <h1>Hello, Welcome!</h1>
                <h3>My name is Catherine Milano. I am a software engineer</h3>
            </HomeBackground>
        </HomeContainer>
    )
}

export default HomeBlock
